INSERT INTO `wp_posts` VALUES (1,1,'2018-05-07 06:29:15','2018-05-07 06:29:15','Welcome to WordPress. This is your first post. Edit or delete it, then start writing!','Hello world!','','publish','open','open','','hello-world','','','2018-05-07 06:29:15','2018-05-07 06:29:15','',0,'http://localhost/ackwine/?p=1',0,'post','',1),(2,1,'2018-05-07 06:29:15','2018-05-07 06:29:15','','Home','','publish','closed','open','','sample-page','','','2018-05-10 02:58:56','2018-05-10 02:58:56','',0,'http://localhost/ackwine/?page_id=2',0,'page','',0),(3,1,'2018-05-07 06:29:43','0000-00-00 00:00:00','','Auto Draft','','auto-draft','open','open','','','','','2018-05-07 06:29:43','0000-00-00 00:00:00','',0,'http://localhost/ackwine/?p=3',0,'post','',0),(4,1,'2018-05-07 06:46:26','2018-05-07 06:46:26','<img class=\"alignleft size-full wp-image-63\" src=\"http://localhost/ackwine/wp-content/uploads/2018/05/Alanna_Mary_2013.jpg\" alt=\"\" width=\"238\" height=\"300\" />Nantucket Wine &amp; Spirits first opened its doors on Steamboat Wharf over thirty five years ago. We began our business, the first of its kind on Nantucket, out of a true love and interest in wine. It is still owned and operated by the Walsh family and we remain as devoted to wine now as we were then. We continue to offer our customers a varied and carefully chosen array of wine, beer, and spirits from all areas of the world. We are proud of our commitment to the community of Nantucket and the longevity of our business.\r\n\r\nThe shop is currently run by mother-daughter duo Mary and Alanna. Mary has been keeping wine drinkers happy on the island since the doors first opened. Alanna returns to Nantucket after years living in San Francisco and working in the wine industry. She brings abundant wine knowledge, inspiration and energy into the shop which is reflected by exciting and carefully chosen wines, spirits and craft beers. You can keep up-to-date with Alanna and the stores latest wine discoveries by following us on Instagram, Twitter or liking our Facebook page.\r\n\r\n&nbsp;\r\n<blockquote><em>What through youth gave love and roses,</em>\r\n<em>Age still leaves us friends and wine.</em>\r\n\r\n<em> Thomas Moore</em></blockquote>','About Us','','publish','closed','closed','','about-us','','','2018-05-10 04:20:49','2018-05-10 04:20:49','',0,'http://localhost/ackwine/?page_id=4',0,'page','',0),(5,1,'2018-05-07 06:46:31','2018-05-07 06:46:31','','Photos','','publish','closed','closed','','photos','','','2018-05-07 06:46:31','2018-05-07 06:46:31','',0,'http://localhost/ackwine/?page_id=5',0,'page','',0),(6,1,'2018-05-07 06:46:37','2018-05-07 06:46:37','[row]\r\n[column md=\"6\"]\r\n[contact-form-7 id=\"65\" title=\"Contact form 1\"]\r\n[/column]\r\n[column md=\"6\"]\r\n<img src=\"http://localhost/ackwine/wp-content/uploads/2018/05/6d-300x192.png\" alt=\"\" width=\"300\" height=\"192\" class=\"alignright size-full wp-image-66\" /> Nantucket Wine & Spirits, located inside Stop & Shop supermarket at the end of aisle 15, is the most convenient location on Nantucket for one-stop shopping. A newly expanded parking lot allows you to get all your shopping essentials without the nightmare of downtown traffic, no place to park and constant congestion. Drive up to our front door (we also have an additional entrance on Pleasant Street) or leave your car where it isour friendly staff will be happy to place your purchases in your car.  Need something delivered to your home? Not a problem!  Do you know what you want and would like it ready when you come into the store?  Call or email us and we will make sure your order is waiting for you when you arrive!\r\n\r\nNantucket Wine & Spirits is open year-round.\r\nOur hours are Monday   Thursday 9am to 9pm, Friday & Saturday 9am-10pm & Sunday 10am to 10pm.\r\n\r\n<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2998.6948545635473!2d-70.09397068457784!3d41.271979479274876!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x89fadd28b7805