,'2018-05-10 02:58:56','2018-05-10 02:58:56','','Home','','inherit','closed','closed','','2-revision-v1','','','2018-05-10 02:58:56','2018-05-10 02:58:56','',2,'http://localhost/ackwine/2018/05/10/2-revision-v1/',0,'revision','',0),(62,1,'2018-05-10 04:16:36','2018-05-10 04:16:36','Nantucket Wine &amp; Spirits first opened its doors on Steamboat Wharf over thirty five years ago. We began our business, the first of its kind on Nantucket, out of a true love and interest in wine. It is still owned and operated by the Walsh family and we remain as devoted to wine now as we were then. We continue to offer our customers a varied and carefully chosen array of wine, beer, and spirits from all areas of the world. We are proud of our commitment to the community of Nantucket and the longevity of our business.\r\n\r\nThe shop is currently run by mother-daughter duo Mary and Alanna. Mary has been keeping wine drinkers happy on the island since the doors first opened. Alanna returns to Nantucket after years living in San Francisco and working in the wine industry. She brings abundant wine knowledge, inspiration and energy into the shop which is reflected by exciting and carefully chosen wines, spirits and craft beers. You can keep up-to-date with Alanna and the stores latest wine discoveries by following us on Instagram, Twitter or liking our Facebook page.\r\n\r\n&nbsp;\r\n<blockquote><em>What through youth gave love and roses,</em>\r\n<em>Age still leaves us friends and wine.</em>\r\n\r\n<em> Thomas Moore</em></blockquote>','About Us','','inherit','closed','closed','','4-revision-v1','','','2018-05-10 04:16:36','2018-05-10 04:16:36','',4,'http://localhost/ackwine/2018/05/10/4-revision-v1/',0,'revision','',0),(63,1,'2018-05-10 04:16:45','2018-05-10 04:16:45','','Alanna_Mary_2013','','inherit','open','closed','','alanna_mary_2013','','','2018-05-10 04:16:45','2018-05-10 04:16:45','',4,'http://localhost/ackwine/wp-content/uploads/2018/05/Alanna_Mary_2013.jpg',0,'attachment','image